package com.kn.concateString;

public class StringConcte {

	public static String concate(String s1, String s2, String s3) {
		// TODO Auto-generated method stub
		return s1 + s2 + s3;
	}

	public static String concateUsingInbuilt(String s1, String s2, String s3) {
		// TODO Auto-generated method stub
		return concate(s1, s2, s3);
	}

}
